import React, { Component } from "react";
import "./Navbar.css";
import { scroller } from "react-scroll";

class Navbar extends Component {
  constructor(props) {
    super(props);
    this.state = {
      design: false
    };
    this.handleClick = this.handleClick.bind(this);
  }

  handleClick(id) {
    this.setState({ design: !design });
  }

  render() {
    return (
      <div className="navbarz">
        <div className="logo_wrap animated rubberBand delay-1.5s">
          <div className="logo">
            <i className="fas fa-skull-crossbones" />
            EV
          </div>
        </div>
        <div className="links">
          <li className="dropdown">
            onClick=
            {this.handleClick}
            <div className="link">Design</div>
            <div className="dropdown-menu">
              <a className="dropdown-item" href="#">
                Grid example
              </a>
              <a className="dropdown-item" href="#">
                Tabs example
              </a>
              <a className="dropdown-item" href="#">
                Login/Sign-up example
              </a>
              <a className="dropdown-item" href="#">
                News example
              </a>
            </div>
          </li>
          <div
            className="link"
            onClick={function() {
              scroller.scrollTo("about", {
                duration: 1500,
                delay: 100,
                smooth: true
              });
            }}
          >
            About
          </div>
          <div
            className="link"
            onClick={function() {
              scroller.scrollTo("contact", {
                duration: 2000,
                delay: 100,
                smooth: true
              });
            }}
          >
            Contact
          </div>
        </div>
      </div>
    );
  }
}

export default Navbar;
